    todoItem: TodoItem;
    removeTodo(TodoNameDelete: string): void;
}

export const InputTodo = ({ todoItem, removeTodo}: Props) => {
    return (
        <div>
            <span>{todoItem.desc}</span>
            <span>{todoItem.category}</span>
            <span>{todoItem.content}</span>
          <button
            onClick={() => {
              removeTodo(todoItem.id);
            }}
          >
            Delete
          </button>
        </div>
    );
};


